        #region Approach 1: Brute force. 
  
        /* Check all possible substrings: their number will be: [ s.Length X (s.Length+1)] / 2
         * Initialize a List with the above capacity, and store the substrings.
         * For each substring in the list, check for the special kind of palindromes, 
         * defined in problem statement
         * 
         * This will not pass with these constraints since its time complexity is O(n^3), Plus its space complexity is O(n^2)
         * We will only use this method to verify results.
         */

        //Time Complexity O(n^3), Auxiliary Space O(n^2).
        private static long SubstrCountBrute(string s, bool debug=false)
        {
            Debug.PrintForDebug($"STRING: {s}\nSUBSTRINGS:", debug);
            int capacity = s.Length * (s.Length + 1) / 2;
            List<string> substrings = new List<string>(capacity); //Space O(n^2)

            //Print all substrings if you like just to have an idea of the size
            //Total Time: O(n^3)
            for (int i = 0; i < s.Length; i++) //Time O(n)
            {
                StringBuilder sb = new StringBuilder(s.Length); //Space O(n)
                for (int j = i; j < s.Length; j++) //Time O(n)
                {
                   
                    sb.Append(s[j]); //Time O(1)
                    substrings.Add(sb.ToString());//Time O(n)
                    if (debug)
                    {
                       Console.WriteLine(sb);
                    }
                }
            }

            int specials = 0;

            //Total Time O(n^3)

            foreach (var substring in substrings) //Time O(n)
            {

                int count = 0;
                for (int i = 0; i < substring.Length/2; i++) //Time O(n)
                {
                   
                    //check for palindromes
                    if (substring[i]!= substring[substring.Length-1-i])
                    {
                        break;
                    }
                    else
                    {
                        count++;
                    }
                }

                if (count== substring.Length/2)
                {
                        //check for special palindromes : "aaaaaa" or  "aaabaaa"
                        char same = substring[0];
                        int counter = 0;
                        for (int i = 0; i < substring.Length / 2; i++)
                        {
                            if (substring[i] != same)
                            {
                                break;
                            }
                            else
                            {
                                counter++;
                            }
                        }
                        if (counter== substring.Length / 2)
                        {
                            Debug.PrintForDebug($"Special string: {substring}", debug);
                            specials++;
                        }
                
                }
                
            }
            return specials;
            
        }
