        #region Approach 2: Divide the problem into 2 sub problems.
        /* Two cases: 
         * First Problem: palindrome substrings have the same character everywhere.
         * Second Problem: palindrome substrings have the same character everywhere except for their middle character.
         * 
         */

        //First Problem: palindrome substrings have the same character everywhere. 

        /*The advantage of this method is that it runs in O(n) time and uses O(1) auxilliary space.
        * The main disadvantage is that unless I had put the print statements /comments, you'd have trouble understanding
        * what the code does, which indicates that refactoring is in order so that the code can speak for itself.
        * Plus it seems hacky.
        */

        //Time Complexity O(n), auxiliary space O(1).
        private static long CountPalindromicSubstringsWithIdenticalCharacters(string s, bool debug = false)
        {
            Debug.PrintForDebug("\n", debug);
            long sub = 0; //Main operation: counter of all special substrings comprised by characters participating in the formation
                         //of contiguous special substrings of length > 1.
                         // Intermediate operation: counter of all characters participating in the formation 
                         //of contiguous special substrings of length > 1.
            long specials = 0; //Main operation: counter of all special substrings i.e those described by sub and those that are essentially
                              //single characters that do not participate in the formation of a longer special substring.


            //This scheme keeps track of the previous character in each step
            //and all cases concerning the last character of the string are treated seperately in the end

            for (int i = 1; i < s.Length; i++)
            {
                if (s[i] != s[i - 1]) //If the previous character is not part of a longer special substring
                {
                    specials++; //that character is a special substring in and of itself.

                    //If the characters participating in a contiguous special substring of length>1 that you have
                    //so far counted are ZERO, then KEEP it ZERO, else GIVE ME THE TOTAL NUMBER OF THOSE SPECIAL SUBSTRINGS.
                    sub = sub == 0 ? 0 : ((sub+1 ) * (sub + 2) / 2); 
                    //note that I have incremented sub by one in the formula, because I haven't actually counted
                    //the last character of the contiguous string yet.

                    if (sub != 0) // If, afterwards, that number is not zero.
                    {
                        Debug.PrintForDebug($"Special contiguuous substrings so far {sub}", debug);
                        specials += sub-1; //add that number to special substrings MINUS 1 so that you won't double
                                          //count the last character of contiguous string in the next iteration.
                        sub = 0; //reset sub at zero for the next time you meet one such case
                    }
                    Debug.PrintForDebug($"Single [{s[i - 1]}, {s[i]}] - special substrings so far {specials}, tempSubSum {sub}", debug);
                }
                else //If the previous character is part of a longer special substring
                {
                    sub++; //increment the relevant counter
                    Debug.PrintForDebug($"------\nContiguous Substring [{s[i - 1]}, {s[i]}] tempSubSum {sub} \n" +
                        $"special non Contiguous Substring characters so far {specials}\n------", debug);
                }
            }


            //With the sceheme above you have not accounted for the last character yet.

            //Case 1.
            /* If there was a contiguous string of identical characters before the last character and the last character
            *  is identical to the contiguous string's character
            *  first increment the length of the contiguous string 
            *  then add the total number of special substrings
            */
            if (sub != 0 && s[s.Length - 1] == s[s.Length - 2])
            {            
                sub++;   
                specials += ((sub) * (sub + 1) / 2); 
            }

            //Case 2.
            /* If there was a contiguous tring of identical characters before the last character and the last character
             * is not identical to the contiguous string's character
             * first add the total number of special substrings
             * then add the last character.
             */
            if (sub != 0 && s[s.Length - 1] != s[s.Length - 2])
            {          
                specials += ((sub) * (sub + 1) / 2);
                specials++;
            }

            //Case 3.
            /* If there wasn't a contiguous tring of identical characters before the last character
             * just add the last character.
             */
            if (sub == 0)  
            {
                specials++;  
            }


            return specials;






        }


        //Second Problem: palindrome substrings have the same character everywhere except for their middle character.
        /*The advantage of this method is that it uses O(1) auxilliary space.
        * The disadvantage is that its time complexity is (probably) O(n^2), and I do not like the exception handling
        * scheme since it seems a bit inelegant. Nevertheless the it clears all testcases with no time outs
        * which implies that for this problem, anything other than O(n^3) is fine. 
        * At some point I will have to come up with something faster.
        */

        //Time Complexity O(n^2), auxiliary space O(1).
        private static long CountPalindromicSubstringsWithIdenticalCharactersExceptMiddle(string s, bool debug = false)
        {
            //"mnonopppoonoop"  you need to catch "non","ono", "oonoo", "ono"


            long specials = 0;

            for (int middle = 1; middle < s.Length - 1; middle++)
            {
                if (s[middle - 1] == s[middle + 1] && s[middle] != s[middle + 1])
                {
                    
                    var step = 1;
                    char same = s[middle - 1];
                    try
                    {
                        while (s[middle + step] == same && s[middle - step] == same)
                        {
                            specials++;
                            step++;
                        }
                    }
                    catch (IndexOutOfRangeException)
                    {
                        if (middle==s.Length-2)
                        {
                            break;
                        }
                        else
                        {
                            continue;
                        }
                       
                    }

                }
            }            


           

            return specials;
        }

        //Above both methods in one.
        private static long SubstrCount(string s, bool debug = false)
        {
            long specials = 0;

            specials += CountPalindromicSubstringsWithIdenticalCharacters(s, debug);

            specials += CountPalindromicSubstringsWithIdenticalCharactersExceptMiddle(s, debug);

            return specials;
        }
