        //For HackerRank without comments/print. 
        //This solution PASSES ALL TESTCASES WITH NO TIMEOUT EXCEPTIONS.
        private static long SubstrCount(string s)
        {
            
            //capture "aa","a" "aaa...aaa" etc
            long sub = 0; 
            long specials = 0;

            for (int i = 1; i < s.Length; i++)
            {
                if (s[i] != s[i - 1]) 
                {
                    specials++;
                    sub = sub == 0 ? 0 : ((sub + 1) * (sub + 2) / 2);
                    if (sub != 0) 
                    { 
                        specials += sub - 1; 
                        sub = 0; 
                    }                   
                }
                else 
                {
                    sub++; 
                }
            }

            if (sub != 0 && s[s.Length - 1] == s[s.Length - 2])
            {
                sub++;
                specials += ((sub) * (sub + 1) / 2);
            }

            if (sub != 0 && s[s.Length - 1] != s[s.Length - 2])
            {
                specials += ((sub) * (sub + 1) / 2);
                specials++;
            }

            if (sub == 0)
            {
                specials++;
            }




            for (int middle = 1; middle < s.Length - 2; middle++)
            {
                if (s[middle - 1] == s[middle + 1] && s[middle] != s[middle + 1])
                {
                    var step = 1;
                    char same = s[middle - 1];
                    try
                    {
                        while (s[middle + step] == same && s[middle - step] == same)
                        {
                            specials++;
                            step++;
                        }
                    }
                    catch (IndexOutOfRangeException)
                    {
                        if (middle == s.Length - 2)
                        {
                            break;
                        }
                        else
                        {
                            continue;
                        }
                    }

                }
            }


            return specials;
        }

